import React, { Component } from "react";


class Header extends Component {

  handleAppsIcon = (e) => {
    document.body.scrollTop = document.documentElement.scrollTop = 0;
    //$("#menudiv").toggle();
  }


  render() {
    var tagOne = "zula";
    var tagTwo = "Sites";

    return (
        <nav className="navbar navbar-expand-md navbar-dark bg-dark fixed-top">
      <a className="navbar-brand" href="#">Navbar</a>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarsExampleDefault" aria-controls="navbarsExampleDefault" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>

      <div className="collapse navbar-collapse" id="navbarsExampleDefault">
        <ul className="navbar-nav mr-auto">
          <li className="nav-item active">
            <a className="nav-link" href="#">Home <span className="sr-only">(current)</span></a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">Link</a>
          </li>
          <li className="nav-item">
            <a className="nav-link disabled" href="#">Disabled</a>
          </li>
          <li className="nav-item dropdown">
            <a className="nav-link dropdown-toggle" href="http://example.com" id="dropdown01" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">Dropdown</a>
            <div className="dropdown-menu" aria-labelledby="dropdown01">
              <a className="dropdown-item" href="#">Action</a>
              <a className="dropdown-item" href="#">Another action</a>
              <a className="dropdown-item" href="#">Something else here</a>
            </div>
          </li>
        </ul>
        <form className="form-inline my-2 my-lg-0">
          <input className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search"/>
          <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
        </form>
      </div>
    </nav>
    );
    return (
      <div className="globalheader">
        <a href="/">
        <div className="globalheader_logo">
          <div className="globalheader_logo_img">
            <img alt="" src={process.env.PUBLIC_URL + '/zulaimglib/cloud.8.png'} 
            style={{width:"100%"}} />
          </div> 
          <div className="globalheader_logo_txt">
          <div className="globalheader_logo_txt_one">{tagOne}</div>
          <div className="globalheader_logo_txt_two">{tagTwo}</div>
          </div>
        </div>
        </a>
        <div className="globalheader_global_links">
          <div onClick={this.handleAppsIcon} className="material-icons globalheader_icon">info</div>
          <div onClick={this.handleAppsIcon} className="material-icons globalheader_icon">settings</div>

        </div>
      </div>
    );
  }
}

export default Header;
